Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,5894,to_date('11-SEP-15 00:00:00','DD-MON-RR HH24:mi:ss'),28,'Application Prepping Production Low - Coaching - Ann expressed she would like more time devoted to application prep. She feels she is still finding new scenarios which slow her down, as she doesn’t know how to handle them. - I''ve assigned Ann the task of live application prep this week to give her additional exposure to the app process. She is to consult myself or her trainer (Carlos) if she finds herself struggling. She should follow up with me regarding her comfort level at the end of the week. ',null,to_date('31-AUG-16 18:30:07','DD-MON-RR HH24:mi:ss'),null,null);
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,5894,to_date('18-SEP-15 00:00:00','DD-MON-RR HH24:mi:ss'),28,'Application Prepping Production Low / Quality Low - Coaching - Ann is feeling overwhelmed with trying to meet quota. She is confused as how to calculate production if she is working on a task for less then an hour or if there is not enough documents to prep for an hour. She is still running into scenarios that confuse her and has to rely on her trainer for help with these. She states she is trying to hurry and feels that is why her quality has dropped. - I''ve explained to Ann that if the quota is 27 applications an hour and there is not enough work to last that long, she only has to calculate the time she spent on the task, not the full hour. We broke down the quota to show that she should try to complete an application every two minutes to keep her on target. She seemed to grasp this and now has a number to time herself with. I also expressed to Ann the importance of ensuring the quality of her work is good. Her task for this upcoming week is to try and improve her production using th',null,to_date('31-AUG-16 18:30:54','DD-MON-RR HH24:mi:ss'),null,null);
