Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,4997,to_date('15-JUN-16 00:00:00','DD-MON-RR HH24:mi:ss'),22,'Becky informed me of the incident between Stan and Chris Russo in the morning. I brought Stan into the conference room for a follow up. I explained to Stan that I had been made aware of the incident and that his behavior towards Chris was unacceptable. Stan acknowledged and explained that this was not the first time it had happened and he had reached his boiling point. Stan also stated that he witnessed Chris disrespect others but had failed to say anything to management. I explained the importance of open communication with me so these incidents can be prevented. Stan understood and said he greatly respected me and the way I handle people, however, felt that he could initially deal with the problem on his own before involving me. He further stated that him addressing Chris must not have worked because he ended up lashing out this morning. Stan stated that he has had prior management experience and just wants to be treated with respect. CONTINUED...',null,to_date('31-AUG-16 19:00:39','DD-MON-RR HH24:mi:ss'),null,null);
