Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,7587,to_date('01-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),18,'Agent earned perfect attendance for the month of August.  Agent scheduled off as well time off approved in advance. ','Briggs, Beckie',to_date('03-SEP-16 11:22:15','DD-MON-RR HH24:mi:ss'),'Briggs, Beckie',to_date('03-SEP-16 11:22:15','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,7587,to_date('03-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),25,'Yauheniya has managed to gain pts to bring her attendance to perfect standing.  Currently at 40pts.  Excellent work.   Yauheniya has demostrated strong content knowledge and uses her resources.  Agent ask for clarification when needed and is very supportive of her team members.  RTQ for the month was in single digits and had 0 days of short calls, dispite several system issues with Siebel. Yauheniya Adherence is on all time high scoring 99%.  Agent manages her scheduled wisely.  She has demonstrated interest in future promotional opportunities, she is well on her way if you continues this trend. ','Briggs, Beckie',to_date('03-SEP-16 11:22:46','DD-MON-RR HH24:mi:ss'),'Briggs, Beckie',to_date('03-SEP-16 11:22:46','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,7330,to_date('03-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),25,'Matilde Earned Perfect Attendance for another consecutive month.  Overall she has been working diligently to increase her overall performance and managed to score 98%;  she has done very well for this month.  Matilde continues to meet Short Calls and RTQ metrics for the entire month.  Due to Siebel system issues, agent would not be penalize for the high RTQ.   Call Wrap up error is also cause for several system issues reported during august.  Matilde Adherence is meeting goal.  She has improved overall and is encourage to continue this growth.  Agent had set a personal goal of achieving 98% in quality and succesfully accomplish it. Great work!','Briggs, Beckie',to_date('03-SEP-16 11:52:52','DD-MON-RR HH24:mi:ss'),'Briggs, Beckie',to_date('03-SEP-16 11:52:52','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,5718,to_date('03-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),25,'Met with Vanessa to discuss Month End Review.  Discuss progress on Quality. Areas of opportunity regarding her hold procedure.  Discuss areas of opportunity while monitoring agent calls.  Agent acknowledge area of improvement and stated she would work on those factors that is preventing her from achieving Higher Quality scores.  Vanessa managed to keep and earned perfect attendance for August.  RTQ was high due to several System issues reported with Siebel.  Short calls were met for the month.  Adherence was also met.  Vanessa continues to excell within the team.  Keep it up!','Briggs, Beckie',to_date('03-SEP-16 12:06:37','DD-MON-RR HH24:mi:ss'),'Briggs, Beckie',to_date('03-SEP-16 12:06:37','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,4393,to_date('03-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),25,'Betzaida managed to improve her quality score to 98%.  Met short calls with 0 days and RTQ was impacted significantly due to several system issues reported in August with Siebel.  Agent managed to keep adherence at 98%.  However Betzaida was coached on returning from breaks and lunches beyond her scheduled time.  Agent has been advised to keep working on her overall performance to be in a better position for promotional opportunities and to show reliability, by improving her attendance. ','Briggs, Beckie',to_date('03-SEP-16 12:20:31','DD-MON-RR HH24:mi:ss'),'Briggs, Beckie',to_date('03-SEP-16 12:20:31','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,7583,to_date('31-AUG-16 00:00:00','DD-MON-RR HH24:mi:ss'),18,'Peterson arrived late at 10.33am reported to attendance line.  Agent requested to use NYC sick hours due to not feeling well which cause his late arrival.  2hrs deducted from current balance.  total balance at 38hrs. ','Briggs, Beckie',to_date('03-SEP-16 12:24:47','DD-MON-RR HH24:mi:ss'),'Briggs, Beckie',to_date('03-SEP-16 12:24:47','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,7583,to_date('01-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),25,'Discuss with Peterson overall performance for August.  Agent average Quality at 97%.  RTQ was impacted due to several Siebel issues reported.   Call Wrap up was also impacted, agent stated that he was unable to call wrap up some calls due to Siebel freezing constantly.  Agent adherence is above goal averaging 98%.  Agent was address on his punctuality during August.  Agent had several occurrences which resulted in lost of points reaching a verbal counseling delivered on 8/2 confirmation email sent to agent on 8/3.','Briggs, Beckie',to_date('03-SEP-16 12:52:20','DD-MON-RR HH24:mi:ss'),'Briggs, Beckie',to_date('03-SEP-16 12:52:20','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,4589,to_date('06-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),17,'Spoke to Greg about his low production percentage. Asked if there was any particular challenge as he hasn''t met production in three months. He said he was struggling with out guides and priority emails. I instructed him to exclude those times from his scanning time to see if there would be an improvement. He will try this for the remainder of the week. Also spoke to Greg about his attendance. He had three non FMLA related incidents last week leaving him at -26 points. - Greg acknowledged the need for change and will explore options for better production percentage. ','Lechman-Parslow, Christopher',to_date('06-SEP-16 20:10:27','DD-MON-RR HH24:mi:ss'),'Lechman-Parslow, Christopher',to_date('06-SEP-16 20:10:27','DD-MON-RR HH24:mi:ss'));
