Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,1854,to_date('02-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),28,'Monthly production update for August 2016-Overall production for Estelle was 107.6%, up from 101.6% in July. LDS-QC Applications, LDS-QC Veri Docs and Outbound Mail QC were all well over 120% production for the month. Estelle still seems to be struggling with Returned Mail and I believe the major contributing factor is her confidence in completing those tasks correctly. All monthly QC''s were completed with all being 100%. Estelle had perfect attendance for the month and her point total remained at 40. I would like Estelle to focus on Returned Mail for the month of September and strive to get over 100% production for the month. ','Lechman-Parslow, Christopher',to_date('08-SEP-16 10:57:25','DD-MON-RR HH24:mi:ss'),'Lechman-Parslow, Christopher',to_date('08-SEP-16 16:27:15','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,3072,to_date('02-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),28,'Monthly production update for August 2016-Lewis had a very good month in August with overall production of 119.0%, up from 115.1% in July. August was the first month since April in which all production categories were over 100% and LDS-QC Apps, Returned Mail and Outbound Mail QC were all over 120%. Lewis was also able to bring LDS-QC Veri Docs up to 113.0% from 96.6% in July. Appeals letter QC was expanded in August and Lewis was one of the QC staff chosen to learn the process. He has done an excellent job with the new process. All 10 monthly QC''s were completed with all being 100%. Lewis ended the month with 39 attendance points. Lewis was interviewed for a QC Team Lead position on 8/29 and at month end is still awaiting whether or not the position is going to be offered to him. Lewis was at 119.0% overall production for the month, I would like for him to strive to be over 120% overall production for the month of September.','Lechman-Parslow, Christopher',to_date('08-SEP-16 11:01:15','DD-MON-RR HH24:mi:ss'),'Lechman-Parslow, Christopher',to_date('08-SEP-16 16:26:50','DD-MON-RR HH24:mi:ss'));
