Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,4291,to_date('02-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),28,'Aug Update-Overall production for Kim was 113.6%, up from 107.0% in July. August was her second full month in QC and Kim was able to improve her production numbers in all categories. LDS-QC Applications went from 74.3% to 75.9%, LDS-QC Veri Docs went from 89.4% to 94.3% and Outbound Mail QC went from 124.5% to 141.0%. Kim seems to be more comfortable in her QC role daily and I believe she will be up over 100% production in LDS-QC Veri Docs in September just through natural progression. She still has a bit of a challenge with the applications that come through LDS. I am going to have Kim sit with one of the seasoned staff members of QC in the first week of September to go through the LDS-QC Application process. All monthly QC''s for Kim were completed with all being 100%. Kim also had perfect attendance for the month and will start 9/1with 29 attendance points. I would like Kim to concentrate on getting LDS-QC Applications and LDS-QC Veri Docs both over 100% for the month of September. ','Lechman-Parslow, Christopher',to_date('08-SEP-16 16:18:47','DD-MON-RR HH24:mi:ss'),'Lechman-Parslow, Christopher',to_date('08-SEP-16 16:24:45','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,4299,to_date('01-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),28,'Monthly production update for August 2016-Mary had a very good month in August with overall production of 171.0%, up from 160.0% in July. All production categories were well over 120%. All 10 monthly QC''s were completed with all being 100%. Mary was interviewed for a position on the new QC Task Team at the end of August and at month end was still awaiting word on if she was going to be offered the position or not.  Mary was trained on Evidence Packets the last week of August. I would like Mary to use the month of September to try to bring Evidence Packet production up to 100%. Mary ended the month with 38 attendance points. A points waiver has been submitted and there has not been a decision by management at this time. I would like Mary to strive for perfect attendance to bring her points back up to 40 if the points waiver is denied. I am also going to be using Mary to help one of the staff who has a challenge with LDS-QC applications. ','Lechman-Parslow, Christopher',to_date('08-SEP-16 16:19:50','DD-MON-RR HH24:mi:ss'),'Lechman-Parslow, Christopher',to_date('08-SEP-16 16:22:52','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,6156,to_date('01-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),28,'Monthly production update for August 2016-Janet had an excellent second month in QC. Overall production was 155.8%, up from 152.5% in July. LDS-QC Veri Docs, Returned Mail and Outbound Mail QC were all over 120%. LDS-QC Applications did drop from 143.8% in July to 118.9% in August. I would attribute that to the lower quantity of applications processed throughout the month. All 10 monthly QC''s were completed with all being 100%. Janet had perfect attendance for the month and her attendance points remained at 40. I would like Janet to work on raising her production in LDS-QC apps while maintaining her production in other categories. Janet has transitioned very well to QC and in the coming months I would like to get her trained on Evidence Packet QC. ','Lechman-Parslow, Christopher',to_date('08-SEP-16 16:21:34','DD-MON-RR HH24:mi:ss'),'Lechman-Parslow, Christopher',to_date('08-SEP-16 16:22:00','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,3105,to_date('01-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),28,'Monthly production update for August 2016-Overall production for Maura was 113.8%, down from 138.9% in July. LDS-QC Apps and Returned Mail were both over 120% for the month. LDS-QC Veri Docs went up to 114.5% from 109.1% in July. Outbound Mail QC went down from 139.1% to 103.4% which I believe is the main reason overall production went down. All 10 monthly QC''s were completed with all being 100%. Maura did have perfect attendance for the month and starting 9/1/2016 her point total will be 33. I would like Maura to focus on Outbound Mail QC for the month of September and get her production in that category back up to 120%.','Lechman-Parslow, Christopher',to_date('08-SEP-16 16:26:20','DD-MON-RR HH24:mi:ss'),'Lechman-Parslow, Christopher',to_date('08-SEP-16 16:26:20','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,6576,to_date('01-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),28,'Monthly production update for August 2016-Linda had another excellent month in August. Overall production for the month was 196.6%. All categories were well over 120% Linda has been very helpful the last couple of months helping staff with Returned Mail questions. All 10 monthly QC''s were completed with all being 100%. Linda ended August with 38 attendance points. I would like to have Linda trained on Evidence Packets in the beginning of September as she has really adjusted to the QC role in her first 5 1/2 months in the position. ','Lechman-Parslow, Christopher',to_date('08-SEP-16 16:28:04','DD-MON-RR HH24:mi:ss'),'Lechman-Parslow, Christopher',to_date('08-SEP-16 16:28:04','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,7305,to_date('01-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),28,'Monthly production update for August 2016-Richard had a very good month in August. He was able to raise his overall production up to 113.0%, from 108.3% in July. LDS-QC Applications, Returned Mail and Outbound Mail QC were all over 120%. LDS-QC Veri Docs was at 118.9%, which is the highest it has been since Richard joined QC earlier this year. All 10 monthly QC''s were completed, with all being 100%. Richard had perfect attendance for the month so starting 9/1/2016, his attendance points will be back at 40. I would like for Richard to work on increasing his produciton for LDS-QC Veri Docs for the month of September.','Lechman-Parslow, Christopher',to_date('08-SEP-16 16:29:49','DD-MON-RR HH24:mi:ss'),'Lechman-Parslow, Christopher',to_date('08-SEP-16 16:29:49','DD-MON-RR HH24:mi:ss'));
Insert into SC_PERFORMANCE_TRACKER (PT_ID,STAFF_ID,PT_ENTRY_DATE,DL_ID,COMMENTS,CREATE_BY,CREATE_DATETIME,LAST_UPDATED_BY,LAST_UPDATED_DATETIME) values (seq_scpt_id.nextval,7306,to_date('02-SEP-16 00:00:00','DD-MON-RR HH24:mi:ss'),28,'Monthly production update for August 2016-Overall production for Sam in August was 166.6%, up from 146.2% in July. All production categories were over 120% for the month. There were 7 monthly QC''s completed for Sam as she was out on vacation from 8/5-8/14, with all being 100%. A DVC for attendance was delivered on 8/25/2016 as her points fell to 24. Even though Sam''s production numbers were very high, there were some mistakes that were found throughout the month(particularly in Returned Mail) and I think Sam needs to slow down a little bit. I would like Sam to strive for perfect attendance for the month to get her attendance points up and to also slow down some to make sure that all tasks are being completed to the highest quality. ','Lechman-Parslow, Christopher',to_date('08-SEP-16 16:34:39','DD-MON-RR HH24:mi:ss'),'Lechman-Parslow, Christopher',to_date('08-SEP-16 16:34:39','DD-MON-RR HH24:mi:ss'));
